function HighlightBox(props) {
    return (
    <div className="HighlightBox">
        <img src={props.HighlightImg} alt={props.HighlightTitle} />
        <div className="HighlightContent">
            <title>{props.HighlightTitle}</title>
            <text>{props.HighlightText}</text>
        </div>
    </div>
 );
}

export default HighlightBox;
